const Item = ({ text, Icon, SelectedIcon }) => {
  const [isSelected, setIsSelected] = useState(false);
  return (
    <div
      onClick={() => {
        setIsSelected(!isSelected);
      }}
      className={`rounded-lg p-2 ${
        isSelected && " bg-Vivid-Red-Tangelo "
      } flex items-center max-w-[210px] w-full cursor-pointer duration-300`}
    >
      <div
        className={`${
          isSelected ? " bg-White  " : " bg-Vivid-Red-Tangelo"
        } duration-300 bg-opacity-20 p-1.5 rounded-lg`}
      >
        {isSelected ? <>{SelectedIcon}</> : <> {Icon}</>}
      </div>
      <h2
        className={`font-semibold text-xs ml-3 ${
          isSelected ? " text-White " : " text-Black "
        }`}
      >
        {text}
      </h2>
    </div>
  );
};

